import (
	context "context"
	fern "github.com/multiple-request-bodies/fern"
	fernclient "github.com/multiple-request-bodies/fern/client"
	option "github.com/multiple-request-bodies/fern/option"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.UploadJsonDocument(
	context.TODO(),
	&fern.UploadDocumentRequest{},
)
